private class EliminationPass extends com.google.javascript.jscomp.NodeTraversal.AbstractShallowCallback {
    private final com.google.javascript.jscomp.ControlFlowGraph<com.google.javascript.rhino.Node> cfg;

    private EliminationPass(com.google.javascript.jscomp.ControlFlowGraph<com.google.javascript.rhino.Node> cfg) {
        this.cfg = cfg;
    }

    @java.lang.Override
    public void visit(com.google.javascript.jscomp.NodeTraversal t, com.google.javascript.rhino.Node n, com.google.javascript.rhino.Node parent) {
        if (((parent == null) || n.isFunction()) || n.isScript()) {
            return;
        }
        com.google.javascript.jscomp.graph.DiGraph.DiGraphNode<com.google.javascript.rhino.Node, com.google.javascript.jscomp.ControlFlowGraph.Branch> gNode = cfg.getDirectedGraphNode(n);
        if (gNode == null) {
            return;
        }
        if ((gNode.getAnnotation() != com.google.javascript.jscomp.graph.GraphReachability.REACHABLE) || (removeNoOpStatements && (!com.google.javascript.jscomp.NodeUtil.mayHaveSideEffects(n, compiler)))) {
            removeDeadExprStatementSafely(n);
            return;
        }
        tryRemoveUnconditionalBranching(n);
    }

    @java.lang.SuppressWarnings("fallthrough")
    private void tryRemoveUnconditionalBranching(com.google.javascript.rhino.Node n) {
        if (n == null) {
            return;
        }
        com.google.javascript.jscomp.graph.DiGraph.DiGraphNode<com.google.javascript.rhino.Node, com.google.javascript.jscomp.ControlFlowGraph.Branch> gNode = cfg.getDirectedGraphNode(n);
        if (gNode == null) {
            return;
        }
        switch (n.getType()) {
            case com.google.javascript.rhino.Token.RETURN :
                if (n.hasChildren()) {
                    break;
                }
            case com.google.javascript.rhino.Token.BREAK :
            case com.google.javascript.rhino.Token.CONTINUE :
                java.util.List<com.google.javascript.jscomp.graph.DiGraph.DiGraphEdge<com.google.javascript.rhino.Node, com.google.javascript.jscomp.ControlFlowGraph.Branch>> outEdges = gNode.getOutEdges();
                if ((outEdges.size() == 1) && ((n.getNext() == null) || n.getNext().isFunction())) {
                    com.google.common.base.Preconditions.checkState(outEdges.get(0).getValue() == com.google.javascript.jscomp.ControlFlowGraph.Branch.UNCOND);
                    com.google.javascript.rhino.Node fallThrough = computeFollowing(n);
                    com.google.javascript.rhino.Node nextCfgNode = outEdges.get(0).getDestination().getValue();
                    if ((nextCfgNode == fallThrough) && (!inFinally(n.getParent(), n))) {
                        removeNode(n);
                    }
                }
        }
    }

    private boolean inFinally(com.google.javascript.rhino.Node parent, com.google.javascript.rhino.Node child) {
        if ((parent == null) || parent.isFunction()) {
            return false;
        } else if (com.google.javascript.jscomp.NodeUtil.isTryFinallyNode(parent, child)) {
            return true;
        } else {
            return inFinally(parent.getParent(), parent);
        }
    }

    private com.google.javascript.rhino.Node computeFollowing(com.google.javascript.rhino.Node n) {
        com.google.javascript.rhino.Node next = com.google.javascript.jscomp.ControlFlowAnalysis.computeFollowNode(n);
        while ((next != null) && next.isBlock()) {
            if (next.hasChildren()) {
                next = next.getFirstChild();
            } else {
                next = computeFollowing(next);
            }
        } 
        return next;
    }

    private void removeDeadExprStatementSafely(com.google.javascript.rhino.Node n) {
        com.google.javascript.rhino.Node parent = n.getParent();
        if (n.isEmpty() || (n.isBlock() && (!n.hasChildren()))) {
            return;
        }
        if (com.google.javascript.jscomp.NodeUtil.isForIn(parent)) {
            return;
        }
        switch (n.getType()) {
            case com.google.javascript.rhino.Token.DO :
                return;
            case com.google.javascript.rhino.Token.BLOCK :
                if (parent.isTry() && com.google.javascript.jscomp.NodeUtil.isTryCatchNodeContainer(n)) {
                    return;
                }
                break;
            case com.google.javascript.rhino.Token.CATCH :
                com.google.javascript.rhino.Node tryNode = parent.getParent();
                com.google.javascript.jscomp.NodeUtil.maybeAddFinally(tryNode);
                break;
        }
        if (n.isVar() && (!n.getFirstChild().hasChildren())) {
            return;
        }
        removeNode(n);
    }

    private void removeNode(com.google.javascript.rhino.Node n) {
        codeChanged = true;
        com.google.javascript.jscomp.NodeUtil.redeclareVarsInsideBranch(n);
        compiler.reportCodeChange();
        if (com.google.javascript.jscomp.UnreachableCodeElimination.logger.isLoggable(java.util.logging.Level.FINE)) {
            com.google.javascript.jscomp.UnreachableCodeElimination.logger.fine("Removing " + n.toString());
        }
        com.google.javascript.jscomp.NodeUtil.removeChild(n.getParent(), n);
    }
}
